import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from "../components/images/black_x.jpg";
import axios from 'axios';
import { Redirect } from 'react-router-dom';

const CreateUser = () => {


  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });

  const [user, setUser] = useState({
    username: "",
    password: "",
    month: "",
    date: "",
    year: ""
  });

  const currentYear = new Date().getFullYear();

  const handleChange = event => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleUserChange = (e) => {
    const { name, value } = e.target;
    setUser((prev) => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async event => {
    event.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/users/', formData);
      console.log(response.data);
      // Optionally, handle the response
    } catch (error) {
      console.error('Error creating user:', error);
    }
  };

  return (
    <>
      <form onSubmit={handleSubmit} className="main_sign">
        <div className="sign-in">
          <span className="cross_div">
            <a className="cre" href="/public">
              <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
            </a>
          </span>
          <div className="nav_1">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
          <div className="down-box">
            <div className="content">
              <p className="acc">Create Account</p>
              <input
                className="box_1"
                type="text"
                name="username"
                value={formData.username}
                onChange={handleChange}
                placeholder="Name"
                maxLength="50"
              />
              <input
                className="box_1"
                type="text"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Email"
              />
              <input
                className="box_1"
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                placeholder="Password"
                maxLength="20"
              />
              <div className="_line "><div>Use Email Instead</div></div>
              <div className="dob">Date of Birth</div>
              <div>This will not be shown publicly. Confirm your own age, even if this account is for a business, a pet, or something else.</div>
              <div className="all_boxes">
                <div className="box_A month">
                  <label>Month</label>
                  <select name="month" value={user.month} onChange={handleUserChange} className="select">
                    {/* Generate options for months from January to December */}
                    {Array.from({ length: 12 }, (_, index) => {
                      const monthIndex = index + 1;
                      const month = monthIndex < 10 ? `0${monthIndex}` : `${monthIndex}`; // Add leading zero if month index is less than 10
                      return (
                        <option key={month} value={month}>
                          {new Date(2000, index, 1).toLocaleString('default', { month: 'long' })}
                        </option>
                      );
                    })}
                  </select>
                </div>
                <div className="box_A date">
                  <label>Date</label>
                  <select value={user.date} onChange={handleUserChange} name="date" className="select">
                    {/* Generate options for dates from 01 to 30 */}
                    {Array.from({ length: 30 }, (_, index) => {
                      const day = index + 1;
                      const formattedDay = day < 10 ? `0${day}` : `${day}`; // Add leading zero if day is less than 10
                      return (
                        <option key={formattedDay} value={formattedDay}>{formattedDay}</option>
                      );
                    })}
                  </select>
                </div>
                <div className="box_A year">
                  <label>Year</label>
                  <select name="year" value={user.year} onChange={handleUserChange} className="select">
                    {/* Generate options for years from 1980 to current year */}
                    {Array.from({ length: currentYear - 1980 + 1 }, (_, index) => {
                      const year = 1980 + index;
                      return (
                        <option key={year} value={year}>{year}</option>
                      );
                    })}
                  </select>
                </div>
              </div>
              <button type="submit" className="box_ grey">Next</button>
            </div>
            <div />
          </div>
        </div>
      </form>
      {redirect && <Redirect to="/signin" />}
    </>
  );
};

export default CreateUser;
